Prior to the 2008 amalgamation, the Rockhampton Region existed as four distinct local government areas:

the City of Rockhampton;
the Shire of Fitzroy;
the Shire of Livingstone (now de-amalgamated);
and the Shire of Mount Morgan.Rockhampton was proclaimed as Queensland's fourth municipality (after Brisbane, Ipswich and Toowoomba) on 13 December 1860 under the Municipalities Act 1858, a piece of New South Wales legislation inherited by Queensland when it became a separate colony in 1859.

